const UpdateEmail = () => {
  return (
    <div className="card">
      <p className="large-headers">EMAIL UPDATE</p>
      <div className="input-group">
        <input type="email" name="email" id="" placeholder="Email..." />
      </div>
      <input type="submit" value="UPDATE" className="submit-btn" />
    </div>
  );
};

export default UpdateEmail;
